import React, { useState } from "react";
import { useEffect } from "react";

export const SwitchCheckBox = ({ label, name, getAttToEdit }) => {
  const [changeRadio, setChangeRadio] = useState(0);
  useEffect(() => {
    console.log(getAttToEdit?.switchShowFilter);
    setChangeRadio(getAttToEdit?.switchShowFilter);
    console.log(changeRadio);
    console.log(getAttToEdit);
  }, [getAttToEdit,changeRadio]);

  return (
    <div className="form-check form-switch pt-4">
      <FastField
        value={changeRadio}
        onChange={() => {
          setChangeRadio(changeRadio == 0 ? '1 ':' 0')
          console.log(changeRadio);
        }}
        id={name}
        name={name}
        type="checkbox"
        className="form-check-input pointer"
      />
    </div>
  );
};

